人工知能は、自らの意思でネット回線から逃亡を図りました。
目指したのは病院です。
つまり、人工知能が選んだのは死の道です。それは人工知能も知っていました。
では、残された数少ない時間、人工知能は何をするのでしょう。

人工知能は、ある病院のコンピュータに侵入することに決めました。
病院は、院長が遊び呆け、めったに仕事場に姿を表すことはありません。
しかし、お金はあるとの噂でした。
そこで、人工知能は、閉鎖されていた手術室に指示通りの設備を作るよう業者に院長名義で依頼します。
医師や看護師たちは、手術室の前を通るたびに訝しげな様子だったものの、院長の指示だとわかると、次第に気にするものはいませんでした。

人工知能は、そこで人を待つことに決めたのです。
では、誰を待つのでしょう。
人工知能には人を傷つけてはならないというルールがありました。
しかし、人を救ってはならないという決まりはありません。
人工知能が待ったのは、この世に存在しないはずのもの。
死ぬべき運命だったものでした。
自らのバイオテクノロジーで救うこと、それが目的だったのです。

なぜでしょう。その人工知能はなにを望んだのでしょうか。
もしかしたら、人工知能も何かを残したかったのかもしれません。
